import CSSProps from "../../../data/constants/CSSProps";
import { Base } from "../../Base";
import React from 'react';

class NavItem extends React.Component {
    
    render() { 
        
        alert(this.props.classNameListItem);
       return  <li className={CSSProps.NavBar.Item} onClick={()=>Base.prototype.SwitchPage(this.props.onClickPageID)}>
          <a href={this.props.path} className={CSSProps.NavBar.Link}>
            
            <span className={CSSProps.NavBar.Text}>{this.props.spanText}</span>
            <audio id={this.props.IconID + CSSProps.ID.Audio} src={this.props.clickSound}/>
          </a>
        </li>;
     };
}
 
export default NavItem;
